import Axios from './caller.services'


let getAllstuff= ()=>{
	return Axios.get('/api/stuff')
}

let getStuff=(uid)=>{
	return Axios.get('/api/stuff/'+uid)
}

let modifiyThing=(credentials)=>{
	return Axios.put('api/stuff/'+uid,credentials)
}
export const stuffService = {
	getAllstuff,
	getStuff,
	modifyThing
}
